using (Transaction t = new Transaction(doc, "Create Conduit"))
{
    t.Start();
    Level level = new FilteredElementCollector(doc).OfClass(typeof(Level)).FirstOrDefault() as Level;
    ElementId conduitTypeId = new FilteredElementCollector(doc).OfClass(typeof(ConduitType)).FirstElementId();

    if (level != null && conduitTypeId != null && conduitTypeId != ElementId.InvalidElementId)
    {
        XYZ start = new XYZ(0, 0, 3 / 0.3048);
        XYZ end = new XYZ(5 / 0.3048, 0, 3 / 0.3048);
        Conduit conduit = Conduit.Create(doc, conduitTypeId, start, end, level.Id);

        if (conduit != null)
        {
            Parameter diameterParam = conduit.get_Parameter(BuiltInParameter.RBS_CONDUIT_DIAMETER_PARAM);
            if (diameterParam != null && !diameterParam.IsReadOnly)
            {
                diameterParam.Set({diameter_inch} / 12.0);
            }
        }
    }
    t.Commit();
}

